import Home1 from "./Home_1";

function HomeWork1() {
    return(
        <div className="boxs">
            <Home1
                O = {{
                    img : "https://picsum.photos/300",
                    name : "Afraa Hakouk",
                    position : "WebDesigner",
                    website : "Cake.com",
                }}
            />
            <Home1
                O = {{
                    img : "https://picsum.photos/201",
                    name : "Abd-Alkader Hakouk",
                    position : "Designer",
                    website : "Logo.com",
                }}
            />
        </div>
    );
}

export default HomeWork1;
